import React from 'react';
import { Text, View } from 'react-native';
import ItemFlower from './ItemFlower';

const Product = () => {
    return (
       <View>
           <Text>Trang chủ của Hoa</Text>
           <ItemFlower></ItemFlower>
       </View>
    );
}

export default Product;
